function distance(a, b){
  return Math.pow(Math.pow(a.x - b.x, 2) +  Math.pow(a.y - b.y, 2),.5);
};

function overlaps(points,point1){
  var seen = {};
  var i;
  for (i = 0; i < points.length; i++) {
    var point = points[i];
    if (seen[point[0]]){
        continue;
    }
    //console.log(point[0]);
    if (distance({x:point[0],y:point[1]},{x:point1[0],y:point1[1]})<(point[2]+point1[2]+buffer)){
        return true;
    }
    seen[point[0]] = true;
  }
  return false;
};

function init(){
    var svg = d3.select("svg");
    // svg.append("circle")
    //     .attr("cx", 150)
    //     .attr("cy", 150)
    //     .attr("r", 140)
    //     .style("fill", "#6603fc");

    var circles = [];
    var tree = new kdTree([], distance, ["x", "y"]);
    var center_to_radius = {};
    var n_w_big_ones = (1-pct_w_big_ones)*data.get("n_populated_groups");
    //var attempts_ = [];
    for (const [key,value] of data.get("vals")){
      var radius = D/2*Math.pow(dens*value[0]/n,.5);
      var attempts = 0;
      while (attempts<max_attempts){
        r = (D/2-radius) * Math.pow(Math.random(),.5);
        theta = Math.random()*2*Math.PI;
        x = r*Math.cos(theta);
        y = r*Math.sin(theta);
        //console.log([x,y,radius]);
        search_res = tree.nearest({"x":x,"y":y}, k);
        //console.log(search_res);
        var points_to_try = [];
        search_res.forEach(function(res){
            //console.log([res[0].x,res[0].y,center_to_radius[[res[0].x,res[0].y]]]);
            points_to_try.push([res[0].x,res[0].y,center_to_radius[[res[0].x,res[0].y]]]);
        });
        if ((circles.length>n_big_ones) && (circles.length>n_w_big_ones)) {
            points_to_try.push.apply(points_to_try, circles.slice(0,n_big_ones));
        }
        //console.log(points_to_try);
        if (!overlaps(points_to_try,[x,y,radius])){
            tree.insert({"x":x,"y":y});
            center_to_radius[[x,y]] = radius;
            circles.push([x,y,radius]);
            //console.log(attempts);
            svg.append("circle")
               .attr("cx", 150+x)
               .attr("cy", 150+y)
               .attr("r", radius)
               .style("fill","none")
               .style("stroke", "red");
            //attempts_.push(attempts);
            break
        }
        attempts += 1;
      }
    }
    //console.log(attempts_);
};

window.addEventListener("load", init);

